import React from "react";
import "../styles/Footer.css";
import {
  FaFacebook,
  FaGithub,
  FaHome,
  FaLinkedin,
  FaLinkedinIn,
  FaMailBulk,
  FaPhone,
} from "react-icons/fa";

const Footer = () => {
  return (
    <div className="footer">
      <div className="footer-containter">
        <div className="left">
          <div>
            <FaHome siz={20} style={{ color: "white", marginRight: "2rem" }} />
            <p>Vancouver, BC</p>
          </div>
          <div>
            <FaPhone siz={20} style={{ color: "white", marginRight: "2rem" }} />
            <p>+1 778 929 3302</p>
          </div>
          <div>
            <FaMailBulk
              siz={20}
              style={{ color: "white", marginRight: "2rem" }}
            />
            <h4 style={{ display: "inline" }}>selenazheng3@gmail.com</h4>
          </div>
        </div>
        <div className="right">
          <h4>Social Media</h4>
          <div className="social">
            <FaGithub
              size={40}
              style={{ color: "white", marginRight: "1rem" }}
            />
            <FaLinkedin
              size={40}
              style={{ color: "white", marginRight: "1rem" }}
            />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Footer;
